import axios from "axios";
import { useState, useEffect} from "react";
import infiniteScroll from 'infinite-scroll';
import './App.css';

export default function App() {
    const [results, setResults] = useState([])
    useEffect(() => {
      axios
        .get('./Foodsource.json?page=2&limit=50')
        .then(res => { 
          setResults(res.data)
        })
        .catch(e => { console.log(e)}) },[]);
        const displayData = results.map(
          (info)=> {
            return(
              <tr>
                <td>{info.resteraunt}</td>
                <td>{info.name}</td>
                <td>{info.people}</td>
                <td>{info.timetag}</td>
              </tr>
            )
          }
        )

        const allrows = document.querySelectorAll(".card")
        console.log(allrows)
        console.log(allrows.length)
        const observer = new IntersectionObserver(entries => {
          entries.forEach(entry => {
            entry.target.classList.toggle("show", entry.isIntersecting)
          })
          console.log(entries)
        })
        observer.observe(allrows[0])



  return (
    <div className="App">
      <div>
      <div class="card show"> {displayData.slice(0,100)}</div>
      <div class="card show"> {displayData.slice(100,200)}</div>
      <div class="card show"> {displayData.slice(200,300)}</div>
      <div class="card show"> {displayData.slice(300,400)}</div>
      </div>
    </div>


  );
}
